import React from 'react'

const Thanksful = () => {
  return (
    <div className="d-flex justify-center align-center flex-column mt-40" style={{marginBottom: 10}}>
        <img  src="../../image/done.png"></img>
        <h1>Your order is accepted
        </h1>
    </div>
  )
}

export default Thanksful
